import React from 'react'
import "./widgetsm.css"
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';
import GroupIcon from '@material-ui/icons/Group';
import AttachMoneyIcon from '@material-ui/icons/AttachMoney';
import RedeemIcon from '@material-ui/icons/Redeem';
import EmojiPeopleIcon from '@material-ui/icons/EmojiPeople';

export default function Widgetsm() {
    return (
        <div className="widgetsm">
            <div className="widgetsmItem">
            <span className="widgetsmTitle">Quick View</span>
            <ul className="widgetLIstItem">
                <li className="widgetsmIcon">
                    <GroupIcon/> Users
                    <div className="widgetData">
                        <span className="widgetNum">271k</span>
                        <span className="widgetRate">+20%</span>
                    </div>
                    <div className="widgetRange">
                        <ArrowUpwardIcon/> 
                        <span className="widgetSub">24hrs</span>
                    </div>

                </li>
            </ul>
                {/* <span className="widgrtsmSub">Compared to last 7 days</span> */}
            <div/> 
            </div>

        </div>
    )
}
